  \"2013-03-15T21:25:18.544384\",\n\t\"name\": \"geomorphic-floodplain-with-organic-matter-biomass-estimates-for-fanno-creek-oregon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fanno Creek is a tributary to the Tualatin
  River and flows though parts of the southwest Portland metropolitan area. The stream
  is heavily influenced by urban runoff and shows characteristic flashy streamflow
  and poor water quality commonly associated with urban streams. This data set represents
  the geomorphic floodplain as derived from light detection and ranging (LiDAR) data
  and aerial photographic imagery. The floodplain represents current conditions including
  both anthropogenic alterations and natural historic floodplain features. The floodplain
  dataset is divided into 13 reach segments and attributed with corresponding organic
  material load estimates for each reach.\",\n\t\"license_title\": null,\n\t\"extras\":
